import React from "react";

export default function Two() {
  return (
    <div>
      <div className="justify-center flex flex-col">
        <span className="text-8xl mt-16 w-full  font-meduim bg-red-50 pb-12  flex justify-center">
          Nous aidons les marques à <br />
          être plus performante & impactante
        </span>
        <span className="flex justify-center">
          <img src="/icon/arrow_circle.svg" alt="" className="w-6 h-6 my-2" />
        </span>
        <span className="flex justify-center font-medium text-xl">
          Nous travaillons sur 4 secteur clés
        </span>
      </div>
    </div>
  );
}
